import React from 'react';
import Card from './Card';
import ServiceData from './ServiceData';
const Services = () => {
    return (
        <>
            <div className='my-5'>
                <h1 className='text-center'>Our Services</h1>
            </div>
            { ServiceData.map((val, index) => {
                return <Card key={index}
                    imgSrc={val.img}
                    title={val.title} />
            })}
        </>
    );
}
export default Services;
